import { toUint8Array } from "https://deno.land/x/base64/mod.ts";

export interface isValid {
  (instance: string | Uint8Array, schema: string | Uint8Array, validate_schema: number): number;
}

export function loadWasm(): { is_valid_str: isValid; is_valid_buf: isValid } {
  return new WebAssembly.Instance(
    new WebAssembly.Module(
      toUint8Array(
        ""
      )
    )
  ).exports as { is_valid_str: isValid; is_valid_buf: isValid };
}
